/// Convert index to Color::Rgb
#[inline]
pub fn header_color(idx: usize) -> Color {
    let (r, g, b) = HEADER_COLORS.get(idx).copied().unwrap_or((0, 0, 0));
    Color::Rgb(r, g, b)
}